@hariharans29 , for latest nightly version (v1.9.0). It performs quite bad. I can't use Batch_Size=32 any more because of "out of shared memory" issue. So, I switch to BS=16 to test. The inference time on 15k is 2333.4 s, which is about 3.2X worse than using official 1.8.1 version, and 9.37X slower than pyTorch 1.9.1. 
- The command I used to install latest nightly version: ```pip install -i https://test.pypi.org/simple/ ort-nightly-gpu```

For the input data part, according to my previous experience, it doesn't matter much, especially for heavy models like this. I don't think it could reduce the 65% (the time gap between pytorch and ORT on this model) by changing IO.
